class App extends React.Component {
  constructor() {
    super()
    this.state = {
      employees: [],
    }
  }

  componentDidMount() {

    axios.get("https://randomuser.me/api/?results=20&nat=us&gender=female")
      .then((responce) => {
        this.setState({ employees: responce.data.results });
